	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING" : "How To Set Up Real-Time Monitoring",
	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING.01HOWTOSETUPREALTIMEMONITORING" : "How to set up real-time monitoring",
	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING.01HOWTOSETUPREALTIMEMONITORING.DESCRIPTION" : "This tutorial will show you how to create task lists and dashboards to monitor and manage your workflows, tasks and documents in real time.<br>\r\n\r\nClick \"My Desktop\" to go to the user area and get started.",
	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING.01HOWTOSETUPREALTIMEMONITORING.TITLE" : "How to set up real-time monitoring",
	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING.02LISTSANDDASHBOARDS" : "Lists and Dashboards",
	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING.02LISTSANDDASHBOARDS.DESCRIPTION" : "There are two main tools you can use for monitoring your tasks, workflows and documents: <br>\r\n\r\n[b]Lists[/b]: detailed table view of your tasks and documents. Used for real-time management;<br>\r\n[b]Dashboards[/b]: graphical (chart) view of your data. Used as a high-level summary view of your task/document statistics.<br>\r\n\r\nClick \"Next\" to learn how to create a custom list.",
	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING.02LISTSANDDASHBOARDS.TITLE" : "Lists and Dashboards",
