	    "HELPER.TUTORIALS.TUTORIALHOWTOSETUPREALTIMEMONITORING.22SHAREDLISTSANDDASHBOARDS.DESCRIPTION" : "We have just created a list and edited a dashboard within your \"My Desktop\" area. By default, you are the only one who can view them.<br>\r\n\r\nYou can create lists within Apps and dashboards within Workspaces so other users can view them too. Use lists for viewing and managing your workflows or documents closely, and then summarize data from several Apps using dashboards. ",
